import React from 'react';



const DraggableList = () => {

let array = [
    {
    id: 'list-1',
    title: 'Automatic',
    thumb: '/path/to/icon'
    }
]

  return (
    <>
      <ul className="characters">
  {array.map(({id, name, thumb}) => {
    return (
      <li key={id}>
        <div className="characters-thumb">
          <img src={thumb} alt={`${name} Thumb`} />
        </div>
        <p>
          { name }
        </p>
      </li>
    );
  })}
</ul>
    </>
  )
}

export default DraggableList;
